import React from 'react'
import { Pie, PieChart, Tooltip } from 'recharts'
import Gender from './Gender';
function Genderchart() {
   
  {
    const data = [
      {name: "Male",value:13, fill:"green"},
      {name:"Female",value:10,fill:"blue"},
      {name:"Required",value:5,fill:"red"},
    ];
    return(
      <div className='chart'>
    <h1>Genderchart</h1>
    <div>
    <PieChart width={500} height={600}id='piechart' >
    <Pie 
    dataKey="value"
    data={data} 
    cx={200}
    cy={200}
    innerRadius={60}
    outerRadius={110}
    fill='orange'
    />
    <Tooltip/>
    </PieChart></div>
      </div>
    )
  }
}


export default Genderchart
